import React from 'react'

export const FolderRow = ({id, name, todoList}) => {
    return (
        <tr>
            <th scope="row">{id}</th>
            <td>{name}</td>
            <td>{todoList.size()}</td>
            <td>@mdo</td>
        </tr>
    )
}
